// for 性能测试
data.nodes.forEach((node) => {
  delete node.x;
  delete node.y;
  delete node.z;
});

clusteredData.clusters.forEach((cluster, i) => {
  cluster.nodes.forEach((node) => {
    node.data.cluster = `c${i}`;
  });
});
clusteredData3D.clusters.forEach((cluster, i) => {
  cluster.nodes.forEach((node) => {
    node.data.cluster = `c${i}`;
  });
});

