const degrees = {};
data.edges.forEach((edge) => {
  const { source, target } = edge;
  degrees[source] = degrees[source] || 0;
  degrees[target] = degrees[target] || 0;
  degrees[source]++;
  degrees[target]++;
});

const { edges, nodes } = data;
export { edges, nodes, degrees };

const getDefaultNodeAnimates = (delay?: number) => ({
  buildIn: [
    {
      fields: ['opacity'],
      duration: 1000,
      delay: delay === undefined ? 1000 + Math.random() * 1000 : delay,
    },
  ],
  buildOut: [
    {
      fields: ['opacity'],
      duration: 200,
    },
  ],
  update: [
    {
      fields: ['lineWidth', 'fill', 'r'],
      shapeId: 'keyShape',
    },
    {
      fields: ['fontSize'],
      shapeId: 'iconShape',
    },
    {
      fields: ['opacity'],
      shapeId: 'haloShape',
    },
  ],
  hide: [
    {
      fields: ['size'],
      duration: 200,
    },
    {
      fields: ['opacity'],
      duration: 200,
      shapeId: 'keyShape',
    },
    {
      fields: ['opacity'],
      duration: 200,
      shapeId: 'labelShape',
    },
  ],
  show: [
    {
      fields: ['size'],
      duration: 200,
    },
    {
      fields: ['opacity'],
      duration: 200,
      shapeId: 'keyShape',
      order: 0,
    },
  ],
});

const getDefaultEdgeAnimates = (delay?: number) => ({
  buildIn: [
    {
      fields: ['opacity'],
      duration: 300,
      delay: delay === undefined ? 1000 + Math.random() * 1000 : delay,
    },
  ],
  buildOut: [
    {
      fields: ['opacity'],
      duration: 200,
    },
  ],
  update: [
    {
      fields: ['lineWidth'],
      shapeId: 'keyShape',
    },
    {
      fields: ['opacity'],
      shapeId: 'haloShape',
    },
  ],
});

const defaultTheme = {
  type: 'spec',
  base: 'dark',
  specification: {
    node: {
      dataTypeField: 'cluster',
    },
  },
};

const create2DGraph = (
  getNodeAnimates = getDefaultNodeAnimates,
  getEdgeAnimates = getDefaultEdgeAnimates,
  theme = defaultTheme,
  zoomConfig = undefined,
  rendererType = 'canvas',
) => {
  console.log('creategraph', theme);
  const graph = new G6.Graph({
    container: container as HTMLcontainer,
    width,
    height: 1400,
    type: 'graph',
    renderer: rendererType,
    data,
    modes: {
      default: [
        { type: 'zoom-canvas', zoomOnItems: true },
        'drag-node',
        'drag-canvas',
        'brush-select',
        'click-select',
      ],
    },
    theme,
    edge: (innerModel) => {
      return {
        ...innerModel,
        data: {
          ...innerModel.data,
          type: 'line-edge',
          animates: getEdgeAnimates(),
        },
      };
    },
    // 节点配置
    node: (innerModel) => {
      const degree = degrees[innerModel.id] || 0;
      let labelLod = 4;
      if (degree > 40) labelLod = -1;
      else if (degree > 20) labelLod = 0;
      else if (degree > 10) labelLod = 1;
      else if (degree > 5) labelLod = 2;
      else if (degree > 2) labelLod = 3;
      return {
        ...innerModel,
        data: {
          animates: getNodeAnimates(),
          ...innerModel.data,
          lodStrategy: {
            levels: [
              { zoomRange: [0, 0.16] }, // -2
              { zoomRange: [0.16, 0.2] }, // -1
              { zoomRange: [0.2, 0.3], primary: true }, // 0
              { zoomRange: [0.3, 0.5] }, // 1
              { zoomRange: [0.5, 0.8] }, // 2
              { zoomRange: [0.8, 1] }, // 3
              { zoomRange: [1, 1.2] }, // 4
              { zoomRange: [1.2, 1.5] }, // 5
              { zoomRange: [1.5, Infinity] }, // 6
            ],
            animateCfg: {
              duration: 500,
            },
          },
          labelShape: {
            text: innerModel.data.label,
            maxWidth: '400%',
            offsetY: 8,
            lod: labelLod,
          },
          labelBackgroundShape: {
            lod: labelLod,
          },
          iconShape: {
            img: 'https://gw.alipayobjects.com/zos/basement_prod/012bcf4f-423b-4922-8c24-32a89f8c41ce.svg',
            fontSize: 12 + degree / 4,
            opacity: 0.8,
            lod: labelLod + 2,
          },
          keyShape: {
            r: 12 + degree / 4,
          },
        },
      };
    },
  });
  // graph.on('afterlayout', (e) => {
  //   Object.keys(degrees).forEach((id) => {
  //     // TODO: graph API for this
  //     if (degrees[id] > 20) {
  //       console.log('tofront', graph.itemController.itemMap[id]);
  //       graph.itemController.itemMap[id].toFront();
  //     }
  //   });
  // });

  if (zoomConfig) {
    graph.zoomTo(zoomConfig.zoom, zoomConfig.center);
  } else {
    graph.zoom(0.15);
  }
  graph.canvas.context.config.canvas.style.transition = 'all 0.3s ease';
  return graph;
};

const create3DGraph = async () => {
  const supported = await supportsThreads();
  const threads = await initThreads(supported);
  const graph = new G6.Graph({
    container: container as HTMLDivElement,
    width,
    height: 1400,
    type: 'graph',

    renderer: 'webgl-3d',
    layout: {
      type: 'force-wasm',
      threads,
      dimensions: 2,
      maxIteration: 100,
      minMovement: 0.4,
      distanceThresholdMode: 'mean',
      height,
      width,
      center: [width / 2, height / 2],
      factor: 1,
      gravity: 10,
      linkDistance: 200,
      edgeStrength: 200,
      nodeStrength: 1000,
      coulombDisScale: 0.005,
      damping: 0.9,
      maxSpeed: 1000,
      interval: 0.02,
    },
    // layout: {
    //   type: 'force',
    //   dimensions: 3,
    //   // iterations: 100,
    //   minMovement: 0.5,
    //   center: [width / 2, height / 2, 0],
    // },
    modes: {
      default: [
        {
          type: 'orbit-canvas-3d',
          trigger: 'drag',
        },
        'zoom-canvas-3d',
      ],
    },

    data: data3d,
    // @ts-ignore
    theme: {
      type: 'spec',
      specification: {
        node: {
          dataTypeField: 'cluster',
        },
      },
    },
    edge: (innerModel) => {
      return {
        ...innerModel,
        data: {
          ...innerModel.data,
          keyShape: {
            lineWidth: 0.3,
            opacity: 0.4,
          },
          type: 'line-edge',
        },
      };
    },
    node: (innerModel) => {
      return {
        ...innerModel,
        data: {
          ...innerModel.data,
          type: 'sphere-node',
          keyShape: {
            r: 12 + degrees[innerModel.id] / 2,
          },
          labelShape:
            degrees[innerModel.id] > 20
              ? {
                  text: innerModel.data.label,
                  fontSize: 100,
                  lod: -1,
                  fill: 'rgba(255,255,255,0.85)',
                  wordWrap: false, // FIXME: mesh.getBounds() returns an empty AABB
                  isBillboard: true,
                }
              : undefined,
        },
      };
    },
  });

  const rotate = (camera, rx: number, ry: number, graph) => {
    const { width, height } = graph.canvas.getConfig();
    const dx = 20.0 / height;
    const dy = 20.0 / width;
    let motionFactorX = 10;
    let motionFactorY = 10;
    if (rx * rx > 2 * ry * ry) {
      motionFactorY *= 0.5;
    } else if (ry * ry > 2 * rx * rx) {
      motionFactorX *= 0.5;
    }

    const rotX = rx * dx * motionFactorX;
    const rotY = ry * dy * motionFactorY;

    camera.rotate(rotX, 0);
  };

  let timer;
  setTimeout(() => {
    const camera = graph.canvas.getCamera();
    const oripos = camera.getPosition();
    let k = 0;
    let i = 0;
    const tick = () => {
      camera.setPosition([oripos[0], oripos[1], oripos[2] + k]);

      const rdx =
        i < 100 ? Math.min(i * 0.5, 20) : Math.min((200 - i) * 0.2, 20);
      rotate(camera, rdx, rdx, graph);

      timer = requestAnimationFrame(tick);
      if (i > 200) cancelAnimationFrame(timer);

      const param = i < 50 ? 3 : 0.5;
      k += 50 * param;
      i++;
    };
    tick();
  }, 1000);

  graph.on('canvas:pointerdown', (e) => {
    if (timer) cancelAnimationFrame(timer);
  });
  graph.on('wheel', (e) => {
    if (timer) cancelAnimationFrame(timer);
  });

  return graph;
};

